import React from "react";

function About(){
    return(
        <div>
            <h1 id = "about_title">Who is this Liam?</h1>
            <div className="left_containter_about">
                <img src = {require('./images/Headshot.jpg')} alt = "Liam Mazure"></img>
                <img src = {require('./images/PittMarathon_Finish.jpg')} alt = "Liam Mazure Pittsburg Marathon"></img>
                <img src = {require('./images/LiamGrace_ParkerWedding.jpg')} alt = "Liam Mazure"></img>
                <img src = {require('./images/UP_Snow.jpg')} alt = "Michignan Upper Penninsula"></img>
                <img src = {require('./images/DetMarathon_21.jpg')} alt = "Liam Mazure"></img>
            </div>
            <div className="right_container_about">
                <p>Liam is a recent graduate from Grand Valley State University where he obtained a B.S. in Computer Science. Liam is an Eastern Michigan transplant originally from Milford, MI(45min north of Ann Arbor/45min NW of Detroit). </p>
            </div>
        </div>

    )
}

export default About;
